column8:
・低騒音！電子パルス方式採用！<br>
・多機能！ダイヤル操作で多彩な作業を最適に行う！<br><br>

［能力 mm］<br>
電子パルスモード・木ねじ：φ4.2×75<br>
ボルトモード・普通ボルト：M4～M10<br>
ボルトモード・高力ボルト：M4～M6<br>
テクスモード・テクスねじ：φ6<br>
ドリルモード・木工：φ21<br>
ドリルモード・鉄工：φ10<br>
ドリルモード・モルタル穴あけ：φ6<br>
電子クラッチモード・小ねじ：M6<br><br>

［六角軸 二面幅mm］<br>
6.35<br><br>

［最大トルク N・m{kgf・cm}］<br>
ボルトモード：30<br>
ドリルモード：11<br>
電子クラッチモード：2.3～5.3（5段階切替）<br><br>

［回転数 min-1 {回/分}］<br>
電子パルスモード：0～1,100<br>
ボルトモード：0～640<br>
テクスモード：0～1,100<br>
ドリルモード：0～1,100<br>
電子クラッチモード：0～450<br><br>

［質量 kg］<br>
1.5<br><br>

［蓄電池］<br>
電圧：14.4V<br>
形名：BSL1430(冷却対応）<br><br>

［充電器］<br>
形名：UC18YSL2(冷却機能付）<br>
時間：約22分<br><br>

［標準付属品］<br>
No.2プラスビット<br><br>

（蓄電池・充電器・ケース別売）
