●特長： インパクト対応ビット。ビスに喰い付きが良く、耐衝撃・耐摩耗性に強い。<br>
六角穴ネジ、キャップスクリュー、セットスクリュー等にご使用下さい。マグネット入。<br>  
●用途： パーテーション・家具組み立て・NCマシンの組み立てやメンテナンス・内装作業などに適しています。<br>
●注意： ※使用時は保護メガネをお付け下さい。負荷の掛けすぎにより破損する事がありますので充分にご注意ください。<br>
使用用途以外又は、電流が流れている個所では、使用しないでください。<br>  
●セット内容： HEX2.0、2.5、3.0、4.0、5.0、6.0×65mm  <br><br>

